// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {ReentrancyGuard} from "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title RegulatoryOracle
 * @dev Core regulatory compliance monitoring and enforcement for DeFi
 * @notice Banks use this to ensure all DeFi activities comply with regulations
 */
contract RegulatoryOracle is Ownable, ReentrancyGuard {
    uint256 private _ruleIdCounter;
    uint256 private _violationIdCounter;
    uint256 private _reportIdCounter;

    constructor(address initialOwner) Ownable(initialOwner) {
        _ruleIdCounter = 0;
        _violationIdCounter = 0;
        _reportIdCounter = 0;
    }

    enum ComplianceRegion {
        US_SEC,
        EU_MICA,
        UK_FCA,
        JAPAN_FSA,
        GLOBAL
    }

    enum RiskLevel {
        LOW,
        MEDIUM,
        HIGH,
        CRITICAL
    }

    enum ViolationType {
        KYC_AML,
        TRANSACTION_LIMIT,
        PROTOCOL_BLACKLIST,
        GEOGRAPHIC_RESTRICTION,
        REPORTING_REQUIREMENT
    }

    struct ComplianceRule {
        uint256 ruleId;
        string ruleName;
        ComplianceRegion region;
        RiskLevel riskLevel;
        bool isActive;
        uint256 createdAt;
        uint256 lastUpdated;
        string ruleDescription;
    }

    struct ComplianceViolation {
        uint256 violationId;
        uint256 ruleId;
        address violatingEntity;
        ViolationType violationType;
        RiskLevel severity;
        uint256 timestamp;
        string details;
        bool resolved;
        uint256 penaltyAmount;
    }

    struct ComplianceReport {
        uint256 reportId;
        address institution;
        uint256 startTimestamp;
        uint256 endTimestamp;
        uint256 totalTransactions;
        uint256 flaggedTransactions;
        uint256 violationCount;
        bool submitted;
    }

    // Core mappings
    mapping(uint256 => ComplianceRule) public complianceRules;
    mapping(uint256 => ComplianceViolation) public violations;
    mapping(uint256 => ComplianceReport) public complianceReports;
    mapping(address => bool) public authorizedInstitutions;
    mapping(address => ComplianceRegion[]) public institutionRegions;

    // Additional specialized mappings for enhanced compliance
    mapping(address => mapping(address => bool)) public protocolWhitelist; // institution => protocol => allowed
    mapping(address => uint256) public amlRiskScores; // address => risk score (0-100)
    mapping(string => bool) public restrictedJurisdictions; // jurisdiction => restricted
    mapping(address => uint256) public lastTransactionTime; // address => timestamp for monitoring

    // Events
    event ComplianceRuleCreated(
        uint256 indexed ruleId,
        ComplianceRegion region,
        RiskLevel riskLevel
    );
    event ViolationDetected(
        uint256 indexed violationId,
        address indexed entity,
        ViolationType violationType
    );
    event ComplianceReportGenerated(
        uint256 indexed reportId,
        address indexed institution
    );
    event InstitutionAuthorized(
        address indexed institution,
        ComplianceRegion[] regions
    );
    event EmergencyFreezeActivated(address indexed institution, string reason);
    event AMLRiskScoreUpdated(address indexed account, uint256 newScore);
    event JurisdictionRestricted(string jurisdiction, bool restricted);
    event ProtocolWhitelisted(
        address indexed institution,
        address indexed protocol,
        bool whitelisted
    );

    /**
     * @dev Add new compliance rule
     */
    function createComplianceRule(
        string memory ruleName,
        ComplianceRegion region,
        RiskLevel riskLevel,
        string memory ruleDescription
    ) external onlyOwner returns (uint256) {
        // Checks
        require(bytes(ruleName).length > 0, "Rule name cannot be empty");
        require(
            bytes(ruleDescription).length > 0,
            "Rule description cannot be empty"
        );

        // Effects
        _ruleIdCounter++;
        uint256 newRuleId = _ruleIdCounter;

        complianceRules[newRuleId] = ComplianceRule({
            ruleId: newRuleId,
            ruleName: ruleName,
            region: region,
            riskLevel: riskLevel,
            isActive: true,
            createdAt: block.timestamp,
            lastUpdated: block.timestamp,
            ruleDescription: ruleDescription
        });

        // Interactions (Events)
        emit ComplianceRuleCreated(newRuleId, region, riskLevel);

        return newRuleId;
    }

    /**
     * @dev Check if transaction complies with all applicable rules
     */
    function checkTransactionCompliance(
        address from,
        address to,
        uint256 amount,
        address protocol
    ) external view returns (bool compliant, string memory reason) {
        // Checks - Basic validation
        if (from == address(0) || to == address(0)) {
            return (false, "Invalid addresses");
        }

        if (amount == 0) {
            return (false, "Amount must be greater than zero");
        }

        // Check if institution is authorized
        if (!authorizedInstitutions[from]) {
            return (false, "Institution not authorized");
        }

        // Check transaction limits (simplified)
        if (amount > 1000000 * 10 ** 6) {
            // $1M limit in USDC
            return (false, "Transaction exceeds limit");
        }

        // Check protocol whitelist (simplified)
        // In real implementation, would check against approved protocols
        if (protocol == address(0)) {
            return (false, "Invalid protocol");
        }

        return (true, "Transaction compliant");
    }

    /**
     * @dev Report compliance violation
     */
    function reportViolation(
        uint256 ruleId,
        address violatingEntity,
        ViolationType violationType,
        string memory details
    ) external returns (uint256) {
        // Checks
        require(
            complianceRules[ruleId].isActive,
            "Rule does not exist or inactive"
        );
        require(violatingEntity != address(0), "Invalid violating entity");
        require(bytes(details).length > 0, "Details cannot be empty");

        // Effects
        _violationIdCounter++;
        uint256 newViolationId = _violationIdCounter;

        violations[newViolationId] = ComplianceViolation({
            violationId: newViolationId,
            ruleId: ruleId,
            violatingEntity: violatingEntity,
            violationType: violationType,
            severity: complianceRules[ruleId].riskLevel,
            timestamp: block.timestamp,
            details: details,
            resolved: false,
            penaltyAmount: _calculatePenalty(complianceRules[ruleId].riskLevel)
        });

        // Interactions (Events)
        emit ViolationDetected(newViolationId, violatingEntity, violationType);

        return newViolationId;
    }

    /**
     * @dev Generate compliance report for institution
     */
    function generateComplianceReport(
        address institution,
        uint256 startTimestamp,
        uint256 endTimestamp
    ) external returns (uint256) {
        // Checks
        require(
            authorizedInstitutions[institution],
            "Institution not authorized"
        );
        require(startTimestamp < endTimestamp, "Invalid time range");
        require(
            endTimestamp <= block.timestamp,
            "End time cannot be in future"
        );

        // Effects
        _reportIdCounter++;
        uint256 newReportId = _reportIdCounter;

        // Simplified report generation - in real implementation would aggregate data
        complianceReports[newReportId] = ComplianceReport({
            reportId: newReportId,
            institution: institution,
            startTimestamp: startTimestamp,
            endTimestamp: endTimestamp,
            totalTransactions: _getTransactionCount(
                institution,
                startTimestamp,
                endTimestamp
            ),
            flaggedTransactions: _getFlaggedCount(
                institution,
                startTimestamp,
                endTimestamp
            ),
            violationCount: _getViolationCount(
                institution,
                startTimestamp,
                endTimestamp
            ),
            submitted: false
        });

        // Interactions (Events)
        emit ComplianceReportGenerated(newReportId, institution);

        return newReportId;
    }

    /**
     * @dev Authorize institution for compliance monitoring
     */
    function authorizeInstitution(
        address institution,
        ComplianceRegion[] memory regions
    ) external onlyOwner {
        // Checks
        require(institution != address(0), "Invalid institution address");
        require(regions.length > 0, "Must specify at least one region");

        // Effects
        authorizedInstitutions[institution] = true;
        institutionRegions[institution] = regions;

        // Interactions (Events)
        emit InstitutionAuthorized(institution, regions);
    }

    /**
     * @dev Get compliance score for institution
     */
    function getComplianceScore(
        address institution
    ) external view returns (uint256 score) {
        // Checks
        require(
            authorizedInstitutions[institution],
            "Institution not authorized"
        );

        // Calculate compliance score based on violation history
        uint256 violationCount = _getRecentViolationCount(institution);

        if (violationCount == 0) {
            return 100;
        } else if (violationCount <= 2) {
            return 85;
        } else if (violationCount <= 5) {
            return 70;
        } else {
            return 50;
        }
    }

    /**
     * @dev Emergency compliance freeze
     */
    function emergencyFreeze(
        address entity,
        string memory reason
    ) external onlyOwner {
        // Checks
        require(entity != address(0), "Invalid entity");
        require(bytes(reason).length > 0, "Reason cannot be empty");

        // Effects
        authorizedInstitutions[entity] = false;

        // Create emergency violation record
        _violationIdCounter++;
        violations[_violationIdCounter] = ComplianceViolation({
            violationId: _violationIdCounter,
            ruleId: 0, // Emergency rule
            violatingEntity: entity,
            violationType: ViolationType.REPORTING_REQUIREMENT,
            severity: RiskLevel.CRITICAL,
            timestamp: block.timestamp,
            details: string(
                bytes.concat(bytes("Emergency freeze: "), bytes(reason))
            ),
            resolved: false,
            penaltyAmount: 0
        });

        // Interactions (Events)
        emit ViolationDetected(
            _violationIdCounter,
            entity,
            ViolationType.REPORTING_REQUIREMENT
        );
    }

    // Internal helper functions
    function _calculatePenalty(
        RiskLevel riskLevel
    ) internal pure returns (uint256) {
        if (riskLevel == RiskLevel.LOW) return 1000 * 10 ** 6; // $1,000 USDC
        if (riskLevel == RiskLevel.MEDIUM) return 10000 * 10 ** 6; // $10,000 USDC
        if (riskLevel == RiskLevel.HIGH) return 100000 * 10 ** 6; // $100,000 USDC
        return 1000000 * 10 ** 6; // $1,000,000 USDC for CRITICAL
    }

    function _getTransactionCount(
        address,
        uint256,
        uint256
    ) internal pure returns (uint256) {
        // Simplified - would integrate with transaction monitoring
        return 100;
    }

    function _getFlaggedCount(
        address,
        uint256,
        uint256
    ) internal pure returns (uint256) {
        // Simplified - would check flagged transactions
        return 2;
    }

    function _getViolationCount(
        address,
        uint256,
        uint256
    ) internal pure returns (uint256) {
        // Simplified - would count violations in timeframe
        return 1;
    }

    function _getRecentViolationCount(address) internal pure returns (uint256) {
        // Simplified - would count recent violations
        return 0;
    }

    /**
     * @dev Set AML risk score for address
     */
    function setAMLRiskScore(
        address account,
        uint256 riskScore
    ) external onlyOwner {
        require(account != address(0), "Invalid account");
        require(riskScore <= 100, "Risk score cannot exceed 100");

        amlRiskScores[account] = riskScore;
        emit AMLRiskScoreUpdated(account, riskScore);
    }

    /**
     * @dev Restrict jurisdiction for compliance
     */
    function restrictJurisdiction(
        string memory jurisdiction,
        bool restricted
    ) external onlyOwner {
        require(bytes(jurisdiction).length > 0, "Invalid jurisdiction");

        restrictedJurisdictions[jurisdiction] = restricted;
        emit JurisdictionRestricted(jurisdiction, restricted);
    }

    /**
     * @dev Whitelist protocol for institution
     */
    function whitelistProtocolForInstitution(
        address institution,
        address protocol,
        bool whitelisted
    ) external onlyOwner {
        require(institution != address(0), "Invalid institution");
        require(protocol != address(0), "Invalid protocol");
        require(
            authorizedInstitutions[institution],
            "Institution not authorized"
        );

        protocolWhitelist[institution][protocol] = whitelisted;
        emit ProtocolWhitelisted(institution, protocol, whitelisted);
    }

    /**
     * @dev Get AML risk score for address
     */
    function getAMLRiskScore(address account) external view returns (uint256) {
        return amlRiskScores[account];
    }

    /**
     * @dev Check if jurisdiction is restricted
     */
    function isJurisdictionRestricted(
        string memory jurisdiction
    ) external view returns (bool) {
        return restrictedJurisdictions[jurisdiction];
    }

    /**
     * @dev Check if protocol is whitelisted for institution
     */
    function isProtocolWhitelisted(
        address institution,
        address protocol
    ) external view returns (bool) {
        return protocolWhitelist[institution][protocol];
    }
}

contracts/TransactionMonitor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title TransactionMonitor
 * @dev Real-time DeFi transaction monitoring for regulatory compliance
 * @notice Monitors all DeFi transactions for suspicious activity and compliance violations
 */
contract TransactionMonitor is Ownable {
    uint256 private _alertIdCounter;

    constructor(address initialOwner) Ownable(initialOwner) {
        _alertIdCounter = 0;
    }

    enum AlertType {
        LARGE_TRANSACTION,
        SUSPICIOUS_PATTERN,
        BLACKLISTED_ADDRESS,
        GEOGRAPHIC_VIOLATION,
        KYC_REQUIRED
    }

    enum AlertSeverity {
        INFO,
        WARNING,
        CRITICAL,
        EMERGENCY
    }

    struct TransactionAlert {
        uint256 alertId;
        address fromAddress;
        address toAddress;
        uint256 amount;
        address protocol;
        AlertType alertType;
        AlertSeverity severity;
        uint256 timestamp;
        bool investigated;
        string notes;
    }

    // Core storage mappings for comprehensive transaction monitoring
    mapping(uint256 => TransactionAlert) public alerts;
    mapping(address => bool) public blacklistedAddresses;
    mapping(address => bool) public whitelistedProtocols;
    mapping(address => uint256) public dailyTransactionVolume;
    mapping(address => uint256) public riskScores;
    mapping(address => uint256) public lastResetTime; // For daily volume tracking
    mapping(address => uint256) public totalTransactionCount; // Lifetime transaction count
    mapping(address => mapping(address => uint256)) public pairTransactionCount; // from => to => count

    // Events
    event TransactionFlagged(
        uint256 indexed alertId,
        address indexed fromAddress,
        AlertType alertType
    );
    event AddressBlacklisted(address indexed account, string reason);
    event ProtocolWhitelisted(address indexed protocol, string name);

    /**
     * @dev Monitor transaction in real-time
     */
    function monitorTransaction(
        address from,
        address to,
        uint256 amount,
        address protocol,
        bytes calldata /*data*/
    ) external returns (bool shouldFlag, AlertType alertType) {
        // Checks
        require(from != address(0) && to != address(0), "Invalid addresses");
        require(amount > 0, "Amount must be greater than zero");

        // Check for large transactions
        if (amount > 100000 * 10 ** 6) {
            // $100,000 USDC
            _createAlert(
                from,
                to,
                amount,
                protocol,
                AlertType.LARGE_TRANSACTION,
                AlertSeverity.WARNING
            );
            return (true, AlertType.LARGE_TRANSACTION);
        }

        // Check blacklisted addresses
        if (blacklistedAddresses[from] || blacklistedAddresses[to]) {
            _createAlert(
                from,
                to,
                amount,
                protocol,
                AlertType.BLACKLISTED_ADDRESS,
                AlertSeverity.CRITICAL
            );
            return (true, AlertType.BLACKLISTED_ADDRESS);
        }

        // Check protocol whitelist
        if (!whitelistedProtocols[protocol]) {
            _createAlert(
                from,
                to,
                amount,
                protocol,
                AlertType.SUSPICIOUS_PATTERN,
                AlertSeverity.WARNING
            );
            return (true, AlertType.SUSPICIOUS_PATTERN);
        }

        // Check daily volume limits
        uint256 dailyVolume = dailyTransactionVolume[from] + amount;
        if (dailyVolume > 1000000 * 10 ** 6) {
            // $1M daily limit
            _createAlert(
                from,
                to,
                amount,
                protocol,
                AlertType.SUSPICIOUS_PATTERN,
                AlertSeverity.CRITICAL
            );
            return (true, AlertType.SUSPICIOUS_PATTERN);
        }

        // Check for suspicious patterns (frequent transactions between same addresses)
        pairTransactionCount[from][to]++;
        if (pairTransactionCount[from][to] > 10) {
            // More than 10 transactions in session
            _createAlert(
                from,
                to,
                amount,
                protocol,
                AlertType.SUSPICIOUS_PATTERN,
                AlertSeverity.WARNING
            );
        }

        // Effects - Update tracking data
        dailyTransactionVolume[from] = dailyVolume;
        totalTransactionCount[from]++;
        totalTransactionCount[to]++;

        return (false, AlertType.LARGE_TRANSACTION);
    }

    /**
     * @dev Create alert for suspicious transaction
     */
    function createAlert(
        address fromAddress,
        address toAddress,
        uint256 amount,
        address protocol,
        AlertType alertType,
        AlertSeverity severity
    ) external onlyOwner returns (uint256) {
        return
            _createAlert(
                fromAddress,
                toAddress,
                amount,
                protocol,
                alertType,
                severity
            );
    }

    /**
     * @dev Internal function to create alert following CEI pattern
     */
    function _createAlert(
        address fromAddress,
        address toAddress,
        uint256 amount,
        address protocol,
        AlertType alertType,
        AlertSeverity severity
    ) internal returns (uint256) {
        // Checks
        require(fromAddress != address(0), "Invalid from address");
        require(toAddress != address(0), "Invalid to address");
        require(amount > 0, "Amount must be greater than zero");

        // Effects
        _alertIdCounter++;
        uint256 newAlertId = _alertIdCounter;

        alerts[newAlertId] = TransactionAlert({
            alertId: newAlertId,
            fromAddress: fromAddress,
            toAddress: toAddress,
            amount: amount,
            protocol: protocol,
            alertType: alertType,
            severity: severity,
            timestamp: block.timestamp,
            investigated: false,
            notes: ""
        });

        // Interactions (Events)
        emit TransactionFlagged(newAlertId, fromAddress, alertType);

        return newAlertId;
    }

    /**
     * @dev Update risk score for address
     */
    function updateRiskScore(
        address account,
        uint256 newScore
    ) external onlyOwner {
        // Checks
        require(account != address(0), "Invalid account");
        require(newScore <= 100, "Risk score cannot exceed 100");

        // Effects
        riskScores[account] = newScore;

        // If high risk, consider flagging
        if (newScore >= 80) {
            _createAlert(
                account,
                address(0),
                0,
                address(0),
                AlertType.SUSPICIOUS_PATTERN,
                AlertSeverity.WARNING
            );
        }
    }

    /**
     * @dev Blacklist suspicious address
     */
    function blacklistAddress(
        address account,
        string memory reason
    ) external onlyOwner {
        // Checks
        require(account != address(0), "Invalid account");
        require(bytes(reason).length > 0, "Reason cannot be empty");

        // Effects
        blacklistedAddresses[account] = true;
        riskScores[account] = 100; // Maximum risk

        // Interactions (Events)
        emit AddressBlacklisted(account, reason);
    }

    /**
     * @dev Whitelist protocol for monitoring
     */
    function whitelistProtocol(
        address protocol,
        string memory name
    ) external onlyOwner {
        // Checks
        require(protocol != address(0), "Invalid protocol");
        require(bytes(name).length > 0, "Name cannot be empty");

        // Effects
        whitelistedProtocols[protocol] = true;

        // Interactions (Events)
        emit ProtocolWhitelisted(protocol, name);
    }

    /**
     * @dev Get transaction analysis
     */
    function analyzeTransaction(
        address from,
        address to,
        uint256 amount,
        address protocol
    )
        external
        view
        returns (
            uint256 riskScore,
            bool requiresKYC,
            bool isCompliant,
            string memory analysis
        )
    {
        // Check risk factors
        uint256 fromRisk = riskScores[from];
        uint256 toRisk = riskScores[to];
        uint256 protocolRisk = whitelistedProtocols[protocol] ? 10 : 50;
        uint256 amountRisk = amount > 100000 * 10 ** 6 ? 30 : 10; // High amount risk

        // Calculate composite risk score
        uint256 compositeRisk = (fromRisk +
            toRisk +
            protocolRisk +
            amountRisk) / 4;

        // Determine compliance
        bool compliant = !blacklistedAddresses[from] &&
            !blacklistedAddresses[to] &&
            compositeRisk < 70;

        // KYC requirement
        bool kyc = compositeRisk > 50 || amount > 50000 * 10 ** 6;

        string memory analysisResult;
        if (compositeRisk < 30) {
            analysisResult = "Low risk transaction";
        } else if (compositeRisk < 70) {
            analysisResult = "Medium risk - monitor closely";
        } else {
            analysisResult = "High risk - requires investigation";
        }

        return (compositeRisk, kyc, compliant, analysisResult);
    }

    /**
     * @dev Mark alert as investigated
     */
    function markAlertInvestigated(
        uint256 alertId,
        string memory notes
    ) external onlyOwner {
        // Checks
        require(alerts[alertId].alertId != 0, "Alert does not exist");
        require(!alerts[alertId].investigated, "Alert already investigated");

        // Effects
        alerts[alertId].investigated = true;
        alerts[alertId].notes = notes;
    }

    /**
     * @dev Get alerts for address
     */
    function getAlertsForAddress(
        address account
    ) external view returns (uint256[] memory alertIds) {
        // Simple implementation - in production would use more efficient storage
        uint256[] memory tempAlerts = new uint256[](_alertIdCounter);
        uint256 count = 0;

        for (uint256 i = 1; i <= _alertIdCounter; i++) {
            if (
                alerts[i].fromAddress == account ||
                alerts[i].toAddress == account
            ) {
                tempAlerts[count] = i;
                count++;
            }
        }

        // Resize array to actual count
        alertIds = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            alertIds[i] = tempAlerts[i];
        }

        return alertIds;
    }
}

